import React, { Component } from 'react';
import './App.css';
/* Components */
import Login from './componets/Login/Login';
import Registration from './componets/Registration/Registration';

function App() {
  return (
    <div className="App">
        <Login/>
        <Registration/>
    </div>
  );
}

export default App;



